 import './index.css';
const landpage=()=>{
    return(
        <div className="container">

            <div className='navbar'>
            <p className='rayn'>Rayn</p>

            <input placeholder='Enter city' type='text' className='city'/>

            </div>
            <div>
            <img src="images/weather2003.png" className="images"/>
            </div>
            </div>



    )


}
export default landpage;
